export class PerformanceModel {
	constructor(data) {
		this.id = data.data.userId;
		this.kind = data.kind;
		this.kindValues = data.data;
	}

	getId() {
		return this.id;
	}

	getPerformances() {
		this.kindValues.forEach((element) => {
			if (element.kind === this.kind) {
				return element.values;
			}
		});
	}
}
